-- CREAR TABLAS
CREATE TABLE IF NOT EXISTS transactions (
  id BIGSERIAL PRIMARY KEY,
  fecha DATE NOT NULL,
  persona TEXT NOT NULL,
  categoria TEXT NOT NULL,
  subcategoria TEXT,
  forma_pago TEXT,
  importe DECIMAL(12,2) NOT NULL,
  tipo TEXT NOT NULL,
  observacion TEXT,
  mes INTEGER,
  anio INTEGER,
  created_at TIMESTAMPTZ DEFAULT NOW()
);

CREATE TABLE IF NOT EXISTS credit_cards (
  id BIGSERIAL PRIMARY KEY,
  nombre TEXT NOT NULL,
  titular TEXT NOT NULL,
  limite DECIMAL(12,2),
  created_at TIMESTAMPTZ DEFAULT NOW()
);

-- ROW LEVEL SECURITY (permite acceso desde la app)
ALTER TABLE transactions ENABLE ROW LEVEL SECURITY;
ALTER TABLE credit_cards ENABLE ROW LEVEL SECURITY;
CREATE POLICY "Allow all" ON transactions FOR ALL USING (true) WITH CHECK (true);
CREATE POLICY "Allow all" ON credit_cards FOR ALL USING (true) WITH CHECK (true);

-- TARJETAS

-- INDICES
CREATE INDEX IF NOT EXISTS idx_tx_persona ON transactions(persona);
CREATE INDEX IF NOT EXISTS idx_tx_mes_anio ON transactions(mes, anio);
CREATE INDEX IF NOT EXISTS idx_tx_tipo ON transactions(tipo);

